import React from 'react';
import './style.css';

export default class TxtOut extends React.Component {

	static defaultProps = {
		label: "Score",
		msg: "..."
	}

	render() {
		const text = <p>{this.props.label + this.props.msg }</p>;

		return (
			<div className="tar">
				{ text }
			</div>
		);
	}
}
